jQuery(function() {
  var init;
  return init = (function() {
    var issuePath;
    issuePath = 'https://api.github.com/repos/laravel/framework/issues';
    return $.getJSON(issuePath, function(response) {
      var issue, _i, _len, _results;
      _results = [];
      for (_i = 0, _len = response.length; _i < _len; _i++) {
        issue = response[_i];
        _results.push($('body').append("<p><img width='50px' src='" + issue.user.avatar_url + "'/> " + issue.user.login + "</p>"));
      }
      return _results;
    });
  })();
});
